// PatientsList.js

import React from 'react';
import PatientItem from './PatientItem';
import classes from './PatientsList.module.css'; // Import the CSS module

function PatientsList({ patients }) {
    return (
        <div className={classes.listContainer}>
            <h2 className={classes.headerPat}>All Patients</h2>
            <div className={classes.searchContainer}>
                <input
                    className={classes.search}
                    type="text"
                    placeholder="Search patients"
                    // Add necessary props or state here
                />
                <button className={classes.closeButton} onClick={() => window.history.back()}>
                    Close
                </button>
            </div>
            {patients.map((patient, index) => (
                <PatientItem
                    key={index}
                    name={patient.name}
                    age={patient.age}
                    lastVisitReason={patient.lastVisitReason}
                />
            ))}
            <button className={classes.closeButton} onClick={() => window.history.back()}>
                Close
            </button>
        </div>
    );
}

export default PatientsList;
